import React from 'react';
import ReactDOM from 'react-dom';
import messi from './messi.jpg';
import maradona from './mara'

const Page = ( <h1 style={{textAlign : 'center', fontSize : '100px'}}> Best players of all time</h1> );

const Yes =()=>{
    return(
        <div>
            <ul style={{ fontSize : '100px' }}>
                <li> Messi</li>
                <img src = {messi} />
                <li> Maradona</li>
                <li> Pele</li>
            </ul>
        </div>
    )
}
ReactDOM.render(Page,document.getElementById("ok"));

ReactDOM.render(<Yes/> ,document.getElementById("root"));
